Treatments.cost_of_treatment, Treatment_Types.treatment_type_description 
 FROM Treatments 
 INNER JOIN Treatment_Types ON Treatments.treatment_type_code = Treatment_Types.treatment_type_code;

Country 
FROM singer 
WHERE Age > 20;

student_id, COUNT(*) AS num_likes 
FROM Likes 
