model_name 
FROM cars_data 
WHERE Weight < (SELECT AVG(Weight) FROM cars_data);

City, COUNT(Employee_ID) 
 FROM employee 
 GROUP BY City;

Students.first_name 
FROM Students 
WHERE Students.current_address_id <> Students.permanent_address_id;

shop.Manager_name, shop.District 
FROM shop 
WHERE shop.Number_products = (
   SELECT MAX(Number_products) FROM shop
);

COUNT(*) FROM flights 
WHERE SourceAirport IN (SELECT AirportCode FROM airports WHERE City = 'Aberdeen') 
AND DestAirport IN (SELECT AirportCode FROM airports WHERE City = 'Ashley');

Country FROM TV_Channel 
 JOIN Cartoon ON TV_Channel.channel_name = Cartoon.Channel 
 WHERE Cartoon.Written_by = 'Todd Casey';

